import React from 'react'
import { Logo, HeaderContainer, A } from './styles'

const Header = ({children}) => (
  <HeaderContainer>
    <A
      style={{textDecoration: 'n'}}
      href='/'>
      <Logo
        style={{ textDecoration: 'none'}}
        title="Gym Club Logo">Peak Scout</Logo>
    </A>
    {children}
  </HeaderContainer>


)

export default Header
